import styled from '@emotion/styled';

export default function Header() {
    return (
        <HeaderStyled>
            <div className="container">
                <div className="logo">
                    <img src="/images/logo.svg" alt="Sites logo" />
                </div>
            </div>
            Header
        </HeaderStyled>
    )
}

const HeaderStyled = styled.header`
    background: ${props => props.theme.colors.primary};
`
